#!/usr/bin/env bash
###
# install-tf2-pyro-sounds.sh
# Self-contained installer for TF2 Pyro sound effects for Claude Code hooks.
# All 17 .wav files are embedded (base64) — no external downloads needed.
#
# Events:
#   SessionStart      → Battle cry / charge activate sounds
#   UserPromptSubmit  → Positive vocalizations / yes / thanks / cheers
#   Stop              → Special completed / evil laugh / happy laugh / taunts
#   Notification      → Jeers / negative vocalization (permission prompts only)
#
# Prerequisites:
#   - macOS (uses afplay + base64 -D)
#
# Usage: bash install-tf2-pyro-sounds.sh
###
set -euo pipefail

SOUNDS_DIR="$HOME/.claude/hooks/sounds/tf2_pyro"
mkdir -p "$SOUNDS_DIR"

echo "Extracting 17 TF2 Pyro sound files..."

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_activatecharge01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_autoonfire01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_battlecry01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_battlecry02.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_cheers01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_jeers01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_jeers02.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_laughevil01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_laughevil02.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_laughhappy01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_laughlong01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_negativevocalization01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_positivevocalization01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_specialcompleted01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_taunts04.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_thanks01.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/Pyro_yes01.wav"

B64EOF

echo ""
echo "Done! TF2 Pyro sounds installed to $SOUNDS_DIR"
echo "To test: afplay $SOUNDS_DIR/Pyro_battlecry01.wav"
